import styled from "@emotion/styled";

const CalendarGrid = styled.section`
  display: grid;
  grid-template-columns: 1fr 1fr 1fr 1fr 1fr 1fr 1fr;

`;
function App() {
  let rawData = {
    year: 2021,
    month: 2,
    days: [],
    label: ["일", "월", "화", "수", "목", "금", "토"],
  };
  [...Array(30).keys()].map((i) => {
    rawData.days.push({ day: i + 1, event: [] });
  });

  return (
    <div>
      <header></header>
      <section>
        <dl>
          <dt>
            <button>left</button>
            <span>2021년 02월</span>
            <button>right</button>
          </dt>
          <dd>
            <ul>
              {rawData.label.map((i) => {
                return <li key={i}>{i}</li>;
              })}
            </ul>
            <CalendarGrid>
              {rawData.days.map((days, index) => {
                return <li key={index}>{days.day}</li>;
              })}
            </CalendarGrid>
          </dd>
        </dl>
      </section>
    </div>
  );
}

export default App;
